css:
* {
  box-sizing: border-box;
}

body {
  margin: 0;
  font-family: 'Poppins', sans-serif;
}

p{
  margin: 0;
}

ul{
  list-style: none;
  margin: 0;
  padding: 0;
}

img {
  max-width: 100%;
  height: auto;
  display: block;
  vertical-align: middle;
}

a {
  color: inherit;
  text-decoration: inherit;
}

.container {
  display: flex;
  max-width: none !important;
  margin-left: auto;
  margin-right: auto;
  margin-bottom: 1.25rem;
}

.sub-container {
  padding-left: 1rem;
  padding-right: 1rem;
}

.heading {
  margin: 1.25rem;
  font-size: 1.5rem;
  line-height: 2rem;
  font-weight: 500;
  text-align: center;
}

@media (min-width: 640px) {
  .heading {
    font-size: 1.875rem;
    line-height: 2.25rem;
  }
}

.product-container {
  display: grid;
  grid-template-columns: repeat(2, minmax(0, 1fr));
  gap: 1rem;
  margin-top: 1.5rem;
}

@media (min-width: 768px) {
  .product-container{
    grid-template-columns: repeat(3, minmax(0, 1fr));
  }
}

@media (min-width: 1024px) {
  .product-container{
    grid-template-columns: repeat(4, minmax(0, 1fr));
  }
}

.product{
  position: relative;
  display: flex;
  flex-direction: column;
  overflow: hidden;
  background-color: #fff;
  border-radius: 0.375rem;
  border: 2px solid rgb(17 24 39);
}

.header{
  overflow: hidden;
}

.footer{
  display: flex;
  flex-direction: column;
  flex: 1 1 0%;
  padding: 1.25rem;
}

.footer .product-cat{
  color: rgb(185 28 28);
  font-size: 0.75rem;
  line-height: 1rem;
  font-weight: 700;
  letter-spacing: 0.025em;
  text-transform: uppercase;
  flex: 1 1 0%
}

.header .product-img{
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition-property: all;
  transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
  transition-duration: 300ms;
}

.footer .product-name{
  margin: 0;
  font-size: 1rem;
  line-height: 1.5rem;
  font-weight: 700;
  margin-top: 0.625rem;
}

.footer .product-price{
  color: rgb(75 85 99);
  font-size: 0.875rem;
  line-height: 1.25rem;
  font-weight: 700;
  margin-top: 0.5rem;
}

.product:hover .product-img{
  transform: scale(1.25);
}
